 que dar clic en el botón “Quiero participar” y crea un usuario, luego de este paso podrás conocer todos los cursos virtuales y acciones que desarrollamos en todas las localidades y en las que puedes participar.'),(282,69,'_descripcion','field_638e6ffc3d853'),(283,69,'contenedor_botones','a:2:{i:0;s:15:\"boton_izquierda\";i:1;s:13:\"boton_derecha\";}'),(284,69,'_contenedor_botones','field_638e702a3d854'),(285,69,'agregar_video','no'),(286,69,'_agregar_video','field_638e1f8264575'),(287,69,'agregar_imagenes_cursos','si'),(288,69,'_agregar_imagenes_cursos','field_638e1fb264576'),(289,70,'_edit_last','1'),(290,70,'_edit_lock','1675219276:1'),(291,70,'descripcion','<span style=\"font-weight: 400;\">Es un espacio creado para la ciudadanía, organizaciones y colectivos para promover el intercambio de experiencias, acciones y esfuerzos para impulsar la cultura del cuidado colectivo y de todas las formas de vida.</span>\r\n\r\n<b>Objetivo</b>\r\n\r\n<span style=\"font-weight: 400;\">Masificar  la cultura del cuidado, autocuidado y de todas las formas de vida. </span>\r\n\r\n<b>Misión​</b>\r\n\r\n<span style=\"font-weight: 400;\">Concientizar y ampliar la cultura del cuidado y salud en todas las formas de vida, en el marco del buen vivir.​</span>\r\n\r\n<b>Visión​</b>\r\n\r\n<span style=\"font-weight: 400;\">Sensibilizar a la sociedad mediante la promoción de la cultura del cuidado.​</span>\r\n\r\n<span style=\"font-weight: 400;\">Por eso invitamos a la ciudadanía a construir una red de promotores/as cuidado, promoviendo y creando formas innovadoras de cuidarte y cuidar a quienes te rodean</span>'),(292,70,'_descripcion','field_638e6ffc3d853'),(293,70,'contenedor_botones','a:2:{i:0;s:15:\"boton_izquierda\";i:1;s:13:\"boton_derecha\";}'),(294,70,'_contenedor_botones','field_638e702a3d854'),(295,70,'agregar_video','no'),(296,70,'_agregar_video','field_638e1f8264575'),(297,70,'agregar_imagenes_cursos','no'),(298,70,'_agregar_imagenes_cursos','field_638e1fb264576'),(299,68,'conte