sticas de las personas que la habitan, para llevar a cabo acciones preventivas y resolutivas en salud. A partir del Análisis de las características de cada territorio, la promoción de las prácticas de cuidado para generar bienestar y la democracia para construir acuerdos y tomar decisiones.'),(1009,121,'_descripcion','field_638e6ffc3d853'),(1010,121,'contenedor_botones','a:2:{i:0;s:13:\"boton_derecha\";i:1;s:13:\"boton_derecha\";}'),(1011,121,'_contenedor_botones','field_638e702a3d854'),(1012,121,'agregar_video','si'),(1013,121,'_agregar_video','field_638e1f8264575'),(1014,121,'agregar_imagenes_cursos','no'),(1015,121,'_agregar_imagenes_cursos','field_638e1fb264576'),(1016,122,'_edit_last','1'),(1017,122,'_edit_lock','1683077868:1'),(1018,122,'descripcion','Desde Territorios de Innovación y Participación en Salud, TIPS Bogotá, brindamos las herramientas y capacidades que permitan construirnos como una sociedad cuidadora de todas las formas de vida que hacen parte del territorio vital de la Bogotá - Región, como lo establece el Nuevo Contrato Social y Ambiental para el Siglo XXI.\r\n\r\nDentro de la estrategia hay 3 dispositivos en los que puedes participar:\r\nPromotores del Cuidado: Da clic en el botón de Promotores del Cuidado, allí encontrarás cursos, charlas y actividades, y puedes hacer parte de la red de Promotores del Cuidado. ¡Realiza el curso virtual gratuito que desees y descarga tu certificado! También puedes participar con acciones colectivas que se realizan en las localidades de Bogotá para cuidar a otras y otros.\r\n\r\nEscuela de Innovación y Participación en Salud ¡Arma tu propio plan de estudios con los temas que más te interesen! Asiste a sesiones presenciales o virtuales, conoce personas, intercambia experiencias en un diálogo de saberes compartidos.\r\n\r\nProyectos de Co-creación: Participa y encuéntrate con otras personas en los laboratorios TIPS Bogotá para dialogar e identificar esas situaciones o realidades que afectan tu territorio, y construir entre todas y todos alternativas innovadoras para darles solución.'),(1019,122,'_descripcion','field_638e6ffc3d853'),(1020,122,'contenedor_botones','a:2:{i:0;s:15:\"boton_izquierda\";i:1;s:13:\"boton_derecha\";}'),(1021,122,'_contenedor_botones','field_638e702a3d854'),(1022,122,'agregar_video','no'),(1023,122,'_agregar_video','field_638e1f8264575'),(1024,122,'agregar_imagenes_cursos','si'),(1025,122,'_agregar_imagenes_cursos','field_638e1fb264576'),(1026,123,'_edit_last','1'),(1027,123,'_edit_lock','1683147186:1'),(1028,123,'descripcion','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Maecenas in pharetra lorem. Aenean luctus vulputate erat lobortis porta. Aenean interdum ultricies massa cursus consectetur. Maecenas euismod purus id augue semper suscipit. Suspendisse potenti. Curabitur turpis neque, auctor non vehicula vel, sollicitudin at libero. Nam molestie erat id accumsan ultricies. Integer tincidunt commodo viverra.'),(1029,123,'_descripcion','field_638e6ffc3d853'),(1030,123,'contenedor_botones','a:2:{i:0;s:15:\"boton_izquierda\";i:1;s:13:\"boton_derecha\";}'),(1031,123,'_contenedor_botones','field_638e702a3d854'),(1032,123,'agregar_video','no'),(1033,123,'_agregar_video','field_638e1f8264575'),(1034,123,'agregar_imagenes_cursos','no'),(1035,123,'_agregar_imagenes_cursos','field_638e1fb264576'),(1036,124,'_edit_last','1'),(1037,124,'_edit_lock','1683148100:1'),(1038,124,'descripcion','Este espacio de participación es posible producto del trabajo conjunto que realiza el equipo encargado de desplegar cada una de las estrategias y herramientas que aquí te ofrecemos, y queremos presentártelo para que puedas conocer los perfiles de las personas que trabajan detrás de bambalinas en la estrategia TIPS Bogotá'),(1039,124,'_descripcion','field_638e6ffc3d853'),(1040,124,'contenedor_botones','a:2:{i:0;s:15:\"boton_izquierda\";i:1;s:13:\"boton_derecha\";}'),(1041,124,'_contenedor_botones','field_638e702a3d854'),(1042,124,'agregar_video','si'),(1043,124,'_ag